  "description": {
    "nb": "Denne undersøkelsen er en nasjonal omdømmeundersøkelse gjennomført av SIU blant internasjonale studenter i Norge. Målet med undersøkelsen er å få økt kunnskap om hvilket omdømme Norge har som studieland, samt å kartlegge motivasjonen internasjonale studenter har for å velge Norge og norske utdanningsinstitusjoner. Gjennom regelmessige undersøkelser vil man kunne oppdage eventuelle endringer i studentenes forventninger til og opplevelser av studielandet Norge. I tillegg avdekkes informasjonstilgang om studietilbud i Norge, udekkede informasjonsbehov, og kunnskap om hvilke informasjonkanaler som er foretrukket av respondentene. Dette er tredje gang SIU gjennomfører en omdømmeundersøkelse blant internasjonale studenter i Norge. Første gang 2008."
  },
