  "title": {
    "nb": "Kulturminnebilder"
  },
  "description": {
    "nb": "I løpet av dei siste 100 åra har Riksantikvaren bygd opp ei stor fotosamling der kulturminne står i sentrum. Nettstedet Kulturminnebilder er Riksantikvarens åpne bildedata. Dei fleste bileta er frå perioden 1870–1960, men det er også ein del nyare bilete. Fototeamet hos Riksantikvaren arbeider kontinuerleg med å gjere fleire bilete tilgjengelege.Bileta er høgoppløyselege og du kan lasta dei ned og bruke dei fritt til alle formål (med nokre unntak). Kvart bilete har opplysningar om kva for reglar som gjeld for bruk, og dette er i hovudsak \"falt i det fri - bildet kan fritt gjengis\" eller ein Creative Commons-lisens av typen CC BY. Enkelte bilete har andre CC-lisensar. Hugs å alltid ta med fotografen sitt namn, og gjerne og Riksantikvarens arkiv som eigar ved gjenbruk av bildene. "
  },
