  "title": {
    "nb": "Husdyrregisteret - data om registrerte storfeindivider"
  },
  "description": {
    "nb": "Datasettet er et uttrekk som består av informasjon om storfeindivider registrert hos Mattilsynet per angitt dato. Data i Husdyrregisteret gjenspeiler hva som til enhver tid er rapportert inn.Det kan være avvik mellom hva som framkommer i Mattilsynets Husdyrregister og hva som faktisk er reelt tilfelle ved direkte observasjon. Avvik kan skyldes alt fra feilregistreringer, via forsinkelser, til mangelfull rapportering.Mattilsynet kan ikke garantere for at alle aktører oppfyller sin rapporteringsplikt. Mattilsynet kan heller ikke gå god for at alle data er korrekt fylt ut av de som har rapportert.Se her for nærmere beskrivelse av hva som skal rapporteres og hvem som er underlagt rapporteringsplikt: http://www.mattilsynet.no/dyr_og_dyrehold/produksjonsdyr/merking_og_registrering_av_produksjonsdyr/rapportering_til_husdyrregisteret__storfe.4942Hjemmel for rapporteringen: https://lovdata.no/dokument/SF/forskrift/2010-07-09-1131Forklaring til de enkelte felteneOpprinnelsesmerke:For norskfødte individer er dette en kombinasjon av de åtte første sifrene fra produsentnummer (se produsentnr) fra der dyret er født og et firesifret individnummer. Storfe fra andre land enn Norge kan ha opprinnelsesmerke bygget opp på annen måte.Opprinnelsesland:Navn på individets opprinnelseslandIndividmerke:Dette en kombinasjon av de åtte første sifrene fra produsentnummer (se dette) fra der dyret er født og et firesifret individnummer. Hvis individet er født i Norge er individmerket identisk med opprinnelsesmerke.Individstatus:Eksempler på status er «Komplett», «Dyr overført. Mangler rapport fra kjøper», «Dyr overført. Mangler rapport fra selger.», «Dyr slaktet. Mangler rapport fra slakteri.», «Dyr rapportert overført fra livdyrhandler/slaktet. Mangler rapport fra kjøper og selger.», «Dyr slaktet. Mangler rapport fra dyrehold.»Individer har en status som er avhengig av de hendelser som er blitt rapportert. Mange hendelser er enkelthendelser, det betyr at de blir rapportert av kun én part ved hjelp av én hendelse. Et eksempel på dette er \u0027Nyfødt dyr merket første gang\u0027. Disse hendelsene har status komplett og medfører enten at et dyr blir opprettet med status komplett eller om dyret allerede finnes så blir ikke dyrets status påvirket.Hendelser som innebærer forflytning krever to, tre eller eventuelt fire hendelser. Dette er fordi alle berørte parter skal rapportere både når et dyr kommer inn i dyreholdet og når det går ut av dyreholdet. Dette gjelder forflytning mellom dyrehold, med eller uten livdyrhandlere, og overføring til slakteri og slakting.Alle hendelser som gjelder overføring mellom dyrehold eller slakting krever at status på dyret er komplett innen første hendelse i forflytningen kan bli registrert.Et individs status kan være representativt kun i det øyeblikket data har blitt hentet ut fra Husdyrregisteret. At et individ framstår som «Komplett» eller med «Manglende rapporter» kan medføre riktighet i det øyeblikket data ble trukket ut, men kanskje ikke umiddelbart etterpå. Født:Individets fødselsdato på formatet dd.mm.ååååKjønn:Individets kjønn er enten «Kvige/ku» for hunkjønn eller «Okse» for hankjønnRasekode:Består av teksten \"LANDDYR$\" + en tallkodeFor forklaring på tallkoden se http://www.mattilsynet.no/integrasjonsstotte/KODEVERK_RASETYPE_no.htmlRase:Rase er betegnelsen på rasekode – i klartekst.Rasebetegnelse:Her kan det framkomme rasen til henholdsvis far (de 16 første sifrene) og mor (de 16 siste sifrene). Det er to og to siffer i par som utgjør koden. For oversikt over de to-sifrete kodene se her: http://www.mattilsynet.no/integrasjonsstotte/KODEVERK_RASETYPE_I_textcode_no.htmlMorsmerke:Hvis individets mor er født i Norge er morsmerket bygget opp på samme måte som Individmerket.Produsentnr:Inneholder 10-sifret produsentnummer. Oppbygning av produsentnummer: Kommunenummer 4 siffer + Gårdsnummer 4 siffer + et løpenummer 2 siffer.Foretaksnr:Dette tilsvarer det som i Brønnøysundregisteret omtales som «Organisasjonsnummer». Kalvingsdato:Dette er siste kalvingsdato registrert i Husdyrregisteret på et individ.Kalving som sådan er ikke en meldepliktig hendelse. Det er hendelsen \"nyfødt kalv merket første gang\" som er meldepliktig. Informasjon om fødselsdato og mors opprinnelsesmerke er blant de obligatoriske opplysninger om denne hendelsen. Kalvingsdatoen utledes fra disse opplysningene.Kalvingsdato kan mangle eller ikke være oppdatert. Årsak kan være for eksempel:Ei ku kan ha fått en kalv som har dødd før den ble merket.Kalven er ikke meldt inn i husdyrregisteret med hendelsen \"nyfødt kalv merket første gang\"."
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eDatasettet er et uttrekk som består av informasjon om storfeindivider registrert hos Mattilsynet per angitt dato. Data i Husdyrregisteret gjenspeiler hva som til enhver tid er rapportert inn.\u003c/p\u003e\u003cp\u003eDet kan være avvik mellom hva som framkommer i Mattilsynets Husdyrregister og hva som faktisk er reelt tilfelle ved direkte observasjon. Avvik kan skyldes alt fra feilregistreringer, via forsinkelser, til mangelfull rapportering.\u003c/p\u003e\u003cp\u003eMattilsynet kan ikke garantere for at alle aktører oppfyller sin rapporteringsplikt. Mattilsynet kan heller ikke gå god for at alle data er korrekt fylt ut av de som har rapportert.\u003c/p\u003e\u003cp\u003eSe her for nærmere beskrivelse av hva som skal rapporteres og hvem som er underlagt rapporteringsplikt: \u003ca href\u003d\"http://www.mattilsynet.no/dyr_og_dyrehold/produksjonsdyr/merking_og_registrering_av_produksjonsdyr/rapportering_til_husdyrregisteret__storfe.4942\" rel\u003d\"nofollow\"\u003ehttp://www.mattilsynet.no/dyr_og_dyrehold/produksjonsdyr/merking_og_registrering_av_produksjonsdyr/rapportering_til_husdyrregisteret__storfe.4942\u003c/a\u003e\u003c/p\u003e\u003cp\u003eHjemmel for rapporteringen: \u003ca href\u003d\"https://lovdata.no/dokument/SF/forskrift/2010-07-09-1131\" rel\u003d\"nofollow\"\u003ehttps://lovdata.no/dokument/SF/forskrift/2010-07-09-1131\u003c/a\u003e\u003c/p\u003eForklaring til de enkelte felteneOpprinnelsesmerke:\u003cp\u003eFor norskfødte individer er dette en kombinasjon av de åtte første sifrene fra produsentnummer (se produsentnr) fra der dyret er født og et firesifret individnummer. Storfe fra andre land enn Norge kan ha opprinnelsesmerke bygget opp på annen måte.\u003c/p\u003eOpprinnelsesland:\u003cp\u003eNavn på individets opprinnelsesland\u003c/p\u003eIndividmerke:\u003cp\u003eDette en kombinasjon av de åtte første sifrene fra produsentnummer (se dette) fra der dyret er født og et firesifret individnummer. Hvis individet er født i Norge er individmerket identisk med opprinnelsesmerke.\u003c/p\u003eIndividstatus:\u003cp\u003eEksempler på status er «Komplett», «Dyr overført. Mangler rapport fra kjøper», «Dyr overført. Mangler rapport fra selger.», «Dyr slaktet. Mangler rapport fra slakteri.», «Dyr rapportert overført fra livdyrhandler/slaktet. Mangler rapport fra kjøper og selger.», «Dyr slaktet. Mangler rapport fra dyrehold.»\u003c/p\u003e\u003cp\u003eIndivider har en status som er avhengig av de hendelser som er blitt rapportert. Mange hendelser er enkelthendelser, det betyr at de blir rapportert av kun én part ved hjelp av én hendelse. Et eksempel på dette er \u0027Nyfødt dyr merket første gang\u0027. Disse hendelsene har status komplett og medfører enten at et dyr blir opprettet med status komplett eller om dyret allerede finnes så blir ikke dyrets status påvirket.\u003c/p\u003e\u003cp\u003eHendelser som innebærer forflytning krever to, tre eller eventuelt fire hendelser. Dette er fordi alle berørte parter skal rapportere både når et dyr kommer inn i dyreholdet og når det går ut av dyreholdet. Dette gjelder forflytning mellom dyrehold, med eller uten livdyrhandlere, og overføring til slakteri og slakting.\u003c/p\u003e\u003cp\u003eAlle hendelser som gjelder overføring mellom dyrehold eller slakting krever at status på dyret er komplett innen første hendelse i forflytningen kan bli registrert.\u003c/p\u003e\u003cp\u003eEt individs status kan være representativt kun i det øyeblikket data har blitt hentet ut fra Husdyrregisteret. At et individ framstår som «Komplett» eller med «Manglende rapporter» kan medføre riktighet i det øyeblikket data ble trukket ut, men kanskje ikke umiddelbart etterpå. \u003c/p\u003eFødt:\u003cp\u003eIndividets fødselsdato på formatet dd.mm.åååå\u003c/p\u003eKjønn:\u003cp\u003eIndividets kjønn er enten «Kvige/ku» for hunkjønn eller «Okse» for hankjønn\u003c/p\u003eRasekode:\u003cp\u003eBestår av teksten \"LANDDYR$\" + en tallkode\u003c/p\u003e\u003cp\u003eFor forklaring på tallkoden se \u003ca href\u003d\"http://www.mattilsynet.no/integrasjonsstotte/KODEVERK_RASETYPE_no.html\" rel\u003d\"nofollow\"\u003ehttp://www.mattilsynet.no/integrasjonsstotte/KODEVERK_RASETYPE_no.html\u003c/a\u003e\u003c/p\u003eRase:\u003cp\u003eRase er betegnelsen på rasekode – i klartekst.\u003c/p\u003eRasebetegnelse:\u003cp\u003eHer kan det framkomme rasen til henholdsvis far (de 16 første sifrene) og mor (de 16 siste sifrene). Det er to og to siffer i par som utgjør koden. For oversikt over de to-sifrete kodene se her: \u003ca href\u003d\"http://www.mattilsynet.no/integrasjonsstotte/KODEVERK_RASETYPE_I_textcode_no.html\" rel\u003d\"nofollow\"\u003ehttp://www.mattilsynet.no/integrasjonsstotte/KODEVERK_RASETYPE_I_textcode_no.html\u003c/a\u003e\u003c/p\u003eMorsmerke:\u003cp\u003eHvis individets mor er født i Norge er morsmerket bygget opp på samme måte som Individmerket.\u003c/p\u003eProdusentnr:\u003cp\u003eInneholder 10-sifret produsentnummer. Oppbygning av produsentnummer: Kommunenummer 4 siffer + Gårdsnummer 4 siffer + et løpenummer 2 siffer.\u003c/p\u003eForetaksnr:\u003cp\u003eDette tilsvarer det som i Brønnøysundregisteret omtales som «Organisasjonsnummer». \u003c/p\u003eKalvingsdato:\u003cp\u003eDette er siste kalvingsdato registrert i Husdyrregisteret på et individ.\u003c/p\u003e\u003cp\u003eKalving som sådan er ikke en meldepliktig hendelse. Det er hendelsen \"nyfødt kalv merket første gang\" som er meldepliktig. Informasjon om fødselsdato og mors opprinnelsesmerke er blant de obligatoriske opplysninger om denne hendelsen. Kalvingsdatoen utledes fra disse opplysningene.\u003c/p\u003e\u003cp\u003eKalvingsdato kan mangle eller ikke være oppdatert. Årsak kan være for eksempel:\u003c/p\u003e\u003cul\u003e\u003cli\u003eEi ku kan ha fått en kalv som har dødd før den ble merket.\u003c/li\u003e\u003cli\u003eKalven er ikke meldt inn i husdyrregisteret med hendelsen \"nyfødt kalv merket første gang\".\u003c/li\u003e\u003c/ul\u003e"
