  "description": {
    "nb": "Data fra smilefjestilsyn gir en samlet oversikt over alle serveringssteder som er omfattet av smilefjesordningen (smilefjesforskriften) og tilsynsresultatene fra Mattilsynets tilsyn fra 1.1. 2016 fram til dags dato.Datasettet Tilsyn http://hotell.difi.no/?dataset\u003dmattilsynet/smilefjes/tilsyn inneholder den tilsvarende informasjonen som plakaten som henges opp hos spisestedene etter at de har hatt tilsyn.Datasettet Kravpunkter http://hotell.difi.no/?dataset\u003dmattilsynet/smilefjes/kravpunkter inneholder hvert enkelt kravpunkt som inngår i ett tilsyn, sammen med karakteren kravpunktet er gitt. Hvert tilsyn vil ha et sett med rader i dette tilsynet, knyttet sammen av tilsynid.Beskrivelse av elementene i datasett for smilefjesTilsynsobjekt:Et tilsynsobjekt er et sted hvor det foregår aktivitet som Mattilsynet skal føre tilsyn med (for smilefjesordningen er dette serveringssteder som er tilrettelagt og beregnet for at maten skal spises på stedet). Et tilsynsobjekt identifiseres entydig ved en intern id, kalt tilsynsobjektid. I tillegg angis hvilken bedrift i Brønnøysundregisteret som eier tilsynsobjektet. Ansvarlig foretak kan da finnes ved å slå opp på www.brreg.no (eller ved bruk av en nettjeneste). Adressene som angis for tilsynsobjektet er interne data med variabel kvalitet, men dette vil bli utbedret etterhvert som tilsynet blir utført. Tilsynsobjekter skifter normalt ikke adresse. Dersom en bedrift flytter en aktivitet fra ett sted til ett annet, vil det oppstå ett nytt tilsynsobjekt.Kravpunkt:Krav i regelverket satt opp som punkter. Kravene retter seg mot tilsynsobjektene og Mattilsynet fører tilsyn med kravene. Kravpunktene er ett spesifikt element i ett tilsyn. Disse kan være obligatoriske ved ordinært tilsyn (se tilsyn).Avvik:Ett kravpunkt som har blitt undersøkt, og hvor Mattilsynet har funnet brudd på regelverket som fører til at det varsles eller fattes vedtak overfor tilsynsobjektet.Tema:Organisering av kravpunkter som benyttes på smilefjesplakaten for å gruppere kravpunkter.Tilsyn:Mattilsynets tilsynsprosess består av et ordinært tilsyn, med påfølgende oppfølgingstilsyn til alle avvik er lukket/utbedret eller tilsynsobjektet legger ned aktiviteten. Når vi utfører et ordinært tilsyn vil alle kravpunkter være mulig å vurdere, men det legges ikke opp til at alle kravpunkter vil bli vurdert ved hvert ordinære tilsyn. På oppfølgingstilsyn vurderes normalt bare de kravpunkt som det ble funnet avvik på, med mindre det har oppstått helt åpenbare avvik (eller det er mistanke om avvik) ved øvrige kravpunkter siden forrige tilsyn.Karakterskala:0 \u003d Ingen brudd på regelverket funnet. Stort smil.1 \u003d Mindre brudd på regelverket som ikke krever oppfølging. Stort smil.2 \u003d Brudd på regelverket som krever oppfølging. Strekmunn.3 \u003d Alvorlig brudd på regelverket. Sur munn.4 \u003d Ikke aktuelt - Virksomheten har ikke denne aktiviteten ved tilsynsobjektet. Påvirker ikke smilefjeskarakter.5 \u003d Ikke vurdert - Mattilsynet har ikke vurdert kravpunktet ved dette tilsynet. Påvirker ikke smilefjeskarakter. Dersom det hadde blitt avdekket mistanke om vesentlige eller åpenbare avvik i forbindelse med inspeksjonen, ville kravpunktet blitt vurdert.Karaktersetting:Det totale smilefjesymbolet etter et tilsyn tilsvarer den dårligste karakteren som blir gitt på tilsynet. Karakter for hvert tema er den dårligste karakteren gitt til kravpunkter under tema.Hvert enkelt kravpunkt gis karakterer på skalaen.Invalidering av tilsyn:Dersom Mattilsynet ikke overholder sine forpliktelser i smilefjesforskriften, eller et påklaget vedtak gis medhold, vil tilsynet og tilsynsresultatet bli trukket tilbake fra åpne data. Informasjonen om dette tilsynet vil ikke lenger være ansett som korrekt. Det er derfor viktig at brukere av datasettet er klar over dette slik at de kan holde sine data oppdatert (1 gang pr. døgn) for å unngå publisering av feilaktig informasjon om et tilsynsobjekt.Deklarasjon av innholdet i datasetteneTilsyn:http://hotell.difi.no/?dataset\u003dmattilsynet/smilefjes/tilsyn - Dette datasettet inneholder den tilsvarende informasjonen som plakaten som henges opp hos spisestedene etter at de har hatt tilsyn.tilsynsobjektid; -Nøkkel for å identifisere tilsynsobjektetorgnummer; -Nøkkel for å koble tilsynsobjektet til eier (i www.brreg.no)navn; -Navnet på tilsynsobjektetadrlinje1; -Adresseadrlinje2; -Adressepostnr; -Postnrpoststed; -Poststedtilsynid; -Nøkkel for å identifisere tilsynetsakref; -Referansenummer for arkivinformasjonstatus; -Gjennomføres \u003d\u0026gt; utestående avvik finnes. Gjennomført \u003d\u0026gt; alle avvik lukket.dato; -Dato tilsynet er utført (ddmmyyyy)karakter; -Smilefjeskarakter for hele tilsynettilsynsbesoektype; -Ordinært eller oppfølgings -tilsyntema_karakter1; -Temanavn:karakter (e.g. Ledelse og rutiner:1)tema_karakter2; -Temanavn:karakter (e.g. Lokaler og utstyr:0)tema_karakter3; -Temanavn:karakter (e.g. Mattilberedning og håndtering:0)tema_karakter4; -Temanavn:karakter (e.g. Sporbarhet og Merking:2)kravpunkter_href; -Lenke til datasett som gir kravpunktene som inngikk i tilsynet.Kravpunkter:http://hotell.difi.no/?dataset\u003dmattilsynet/smilefjes/kravpunkter - Dette datasettet inneholder hvert enkelt kravpunkt som inngår i ett tilsyn, sammen med karakteren kravpunktet er gitt. Hvert tilsyn vil ha ett sett med rader i dette tilsynet, knyttet sammen av tilsynid.\"tilsynid\"; - Nøkkel for identifisere ett tilsyn\"dato\"; - Dato tilsynet er utført\"tema.kravpunkt\"; - Nøkkel for å identifisere ett kravpunkt (ikke unik over tid)\"kravpunktnavn\"; - Navn på kravpunktet\"karakter\"; - Karakter (utifra skala)\"tekst_no\"; - Tekstlig beskrivelse av karakter, bokmål\"tekst_nn\"; - Tekstlig beskrivelse av karakter, nynorsk\"tilsyn_href\";\" - Lenke til tilsynet, slik at kravpunkter kan kobles sammen med tilsynsobjektet"
