  "title": {
    "nb": "Yrkesbeskrivelser fra utdanning.no"
  },
  "description": {
    "nb": "Datasettet inneholder tekstlige beskrivelser og klassifisering av over 550 yrker. Yrkene er skrevet av redaksjonen hos utdanning.no og kvalitetssikres jevnlig av over 200 organisasjoner i arbeidslivet.NavngivingDersom du benytter yrkesbeskrivelsene ber vi om at endringer og tillegg merkes, og at du henviser til kilden på følgende måte: \"Yrkesbeskrivelsen er basert på åpne data fra utdanning.no og er underlagt Norsk lisens for offentlige data (NLOD). Teksten vedlikeholdes på yrkessiden på utdanning.no.\"Relaterte kodeverkYrkene er klassifisert etter standard for yrkesklassifisering (STYRK98), norsk standard for utdanningsgruppering (NUS2000) og interesser, samt at de inneholder lenker til intervju av yrkesutøvere.Hvordan benytte datasettet?Datasettet er XML-basert og lister ut alle yrker i Atom-format. Innholdet er søkbart slik at det er mulig å bare hente ut yrker basert på for eksempel STYRK, NUS, interesser, fritekstsøk eller en kombinasjon av disse. Eksempler på bruk følger.Hente ut alle yrker som er klassifisert med NUS-koder som starter med 45 eller 46, \"Naturvitenskapelige fag, håndverksfag og tekniske fag\", videregående avsluttende utdanning eller grunnutdanning: - https://utdanning.no/data/atom/yrke?fq\u003dsm_field_nus_field_nus_code:(45 OR 35)Hente ut alle yrker som er merket med interessen helse: - https://utdanning.no/data/atom/yrke?fq\u003dsm_field_interesse_label:helseHente ut alle yrker som er merket med yrkesklassifiseringskode 7134116, \"Lærling (rørlegger)\": - https://utdanning.no/data/atom/yrke?fq\u003dsm_field_styrk98_field_code_styrk:7134116Fritekstsøk i yrkesbasen: - https://utdanning.no/data/atom/yrke?q\u003drørleggerEn kan også kombinere og søke etter flere kriterier på en gang: - https://utdanning.no/data/atom/yrke?q\u003drørlegger\u0026amp;fq\u003dsm_field_styrk98_field_code_styrk:7134116\u0026amp;fq\u003dsm_field_nus_field_nus_code:45 - Fritekstsøk: rørlegger - FIltrere på yrker som er tagget med yrkesklassifisering \"Lærling (rørlegger)\" - Filtrere på yrker som er tagget med utdanningsgruppering \"Naturvitenskapelige fag, håndverksfag og tekniske fag\" (Videregående, avsluttende utdanning)"
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eDatasettet inneholder tekstlige beskrivelser og klassifisering av over 550 yrker. Yrkene er skrevet av redaksjonen hos \u003ca href\u003d\"https://utdanning.no\" rel\u003d\"nofollow\"\u003eutdanning.no\u003c/a\u003e og kvalitetssikres jevnlig av over 200 organisasjoner i arbeidslivet.\u003c/p\u003e\u003cp\u003e\u003cstrong\u003eNavngiving\u003c/strong\u003e\u003cbr\u003eDersom du benytter yrkesbeskrivelsene ber vi om at endringer og tillegg merkes, og at du henviser til kilden på følgende måte: \"Yrkesbeskrivelsen er basert på åpne data fra \u003ca href\u003d\"https://utdanning.no\" rel\u003d\"nofollow\"\u003eutdanning.no\u003c/a\u003e og er underlagt Norsk lisens for offentlige data (\u003ca href\u003d\"https://data.norge.no/nlod/no\" rel\u003d\"nofollow\"\u003eNLOD\u003c/a\u003e). Teksten vedlikeholdes på \u003ca href\u003d\"https://utdanning.no/interesseoversikt#/yrker/\" rel\u003d\"nofollow\"\u003eyrkessiden\u003c/a\u003e på \u003ca href\u003d\"https://utdanning.no\" rel\u003d\"nofollow\"\u003eutdanning.no\u003c/a\u003e.\"\u003c/p\u003e\u003cp\u003e\u003cstrong\u003eRelaterte kodeverk\u003c/strong\u003e\u003cbr\u003eYrkene er klassifisert etter standard for yrkesklassifisering (\u003ca href\u003d\"https://www.ssb.no/a/yrke/\" rel\u003d\"nofollow\"\u003eSTYRK98\u003c/a\u003e), norsk standard for utdanningsgruppering (\u003ca href\u003d\"https://www.ssb.no/utdanning/artikler-og-publikasjoner/nus2000\" rel\u003d\"nofollow\"\u003eNUS2000\u003c/a\u003e) og interesser, samt at de inneholder lenker til intervju av yrkesutøvere.\u003c/p\u003e\u003cp\u003e\u003cstrong\u003eHvordan benytte datasettet?\u003c/strong\u003e\u003cbr\u003eDatasettet er XML-basert og lister ut alle yrker i Atom-format. Innholdet er søkbart slik at det er mulig å bare hente ut yrker basert på for eksempel STYRK, NUS, interesser, fritekstsøk eller en kombinasjon av disse. Eksempler på bruk følger.\u003c/p\u003e\u003cp\u003eHente ut alle yrker som er klassifisert med NUS-koder som starter med 45 eller 46, \"Naturvitenskapelige fag, håndverksfag og tekniske fag\", videregående avsluttende utdanning eller grunnutdanning:\u003cbr\u003e - \u003ca href\u003d\"https://utdanning.no/data/atom/yrke?fq\u003dsm_field_nus_field_nus_code:(45 OR 35)\" rel\u003d\"nofollow\"\u003ehttps://utdanning.no/data/atom/yrke?fq\u003dsm_field_nus_field_nus_code:(45 OR 35)\u003c/a\u003e\u003c/p\u003e\u003cp\u003eHente ut alle yrker som er merket med interessen helse:\u003cbr\u003e - \u003ca href\u003d\"https://utdanning.no/data/atom/yrke?fq\u003dsm_field_interesse_label:helse\" rel\u003d\"nofollow\"\u003ehttps://utdanning.no/data/atom/yrke?fq\u003dsm_field_interesse_label:helse\u003c/a\u003e\u003c/p\u003e\u003cp\u003eHente ut alle yrker som er merket med yrkesklassifiseringskode 7134116, \"Lærling (rørlegger)\":\u003cbr\u003e - \u003ca href\u003d\"https://utdanning.no/data/atom/yrke?fq\u003dsm_field_styrk98_field_code_styrk:7134116\" rel\u003d\"nofollow\"\u003ehttps://utdanning.no/data/atom/yrke?fq\u003dsm_field_styrk98_field_code_styrk:7134116\u003c/a\u003e\u003c/p\u003e\u003cp\u003eFritekstsøk i yrkesbasen:\u003cbr\u003e - \u003ca href\u003d\"https://utdanning.no/data/atom/yrke?q\u003drørlegger\" rel\u003d\"nofollow\"\u003ehttps://utdanning.no/data/atom/yrke?q\u003drørlegger\u003c/a\u003e\u003c/p\u003e\u003cp\u003eEn kan også kombinere og søke etter flere kriterier på en gang:\u003cbr\u003e - \u003ca href\u003d\"https://utdanning.no/data/atom/yrke?q\u003drørlegger\u0026amp;fq\u003dsm_field_styrk98_field_code_styrk:7134116\u0026amp;fq\u003dsm_field_nus_field_nus_code:45\" rel\u003d\"nofollow\"\u003ehttps://utdanning.no/data/atom/yrke?q\u003drørlegger\u0026amp;fq\u003dsm_field_styrk98_field_code_styrk:7134116\u0026amp;fq\u003dsm_field_nus_field_nus_code:45\u003c/a\u003e\u003cbr\u003e - Fritekstsøk: rørlegger\u003cbr\u003e - FIltrere på yrker som er tagget med yrkesklassifisering \"Lærling (rørlegger)\"\u003cbr\u003e - Filtrere på yrker som er tagget med utdanning