  "title": {
    "nb": "Barnehagefakta (BAF)"
  },
  "description": {
    "nb": "Barnehagefakta.no er Utdanningsdirektoratets portal for publisering av nøkkeltall og nøkkelinformasjon for barnehager i Norge. Portalen er tilgjengelig på Barnehagefakta.no eller Barnehagefakta.udir.no. I tillegg til å gi brukeren informasjon som adresse, plassering og pedagogisk profil, publiserer portalen ulike nøkkeltall for barnehagene som antall barn per ansatt og ansattes utdanningsbakgrunn. Alle data i løsningen karakteriseres som åpne data, og er fritt tilgjengelig gjennom åpne API.Vi tilbyr i dag et REST-grensesnitt mot datene (som er det samme grensesnittet som Udirs egen løsning benytter). Data fra APiet leveres på JSON-format."
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eBarnehagefakta.no er Utdanningsdirektoratets portal for publisering av nøkkeltall og nøkkelinformasjon for barnehager i Norge. Portalen er tilgjengelig på \u003ca href\u003d\"http://Barnehagefakta.no\" rel\u003d\"nofollow\"\u003eBarnehagefakta.no\u003c/a\u003e eller \u003ca href\u003d\"http://Barnehagefakta.udir.no\" rel\u003d\"nofollow\"\u003eBarnehagefakta.udir.no\u003c/a\u003e. I tillegg til å gi brukeren informasjon som adresse, plassering og pedagogisk profil, publiserer portalen ulike nøkkeltall for barnehagene som antall barn per ansatt og ansattes utdanningsbakgrunn. Alle data i løsningen karakteriseres som åpne data, og er fritt tilgjengelig gjennom åpne API.\u003c/p\u003e\u003cp\u003eVi tilbyr i dag et REST-grensesnitt mot datene (som er det samme grensesnittet som Udirs egen løsning benytter). Data fra APiet leveres på JSON-format.\u003c/p\u003e"
