  "title": {
    "nb": "API Ruteplantjeneste for bil"
  },
  "description": {
    "nb": "Ruteplantjenesten for bilkjøring beregner opp til tre ulike reiseruter mellom to punkter. Man kan også definere inntil åtte omkjøringspunkter.Tjenesten er beregnet for utviklere som vil anvende ruteberegneren i sine applikasjoner på web eller mobil. Tjenesten er et REST-inspirert API og skal være tilstrekkelig godt dokumentert til at man kan ta den i bruk hvis man har brukbare programmeringskunnskaper. Data er tilgjengelig i åpne formater som XML og JSON. Koordinater blir som standard levert på den proprietære, men åpent tilgjengelige standarden ESRI compact geometry, men med parameteren geometryformat kan man også velge mer konvensjonelle formatteringer (gml, iso). Føy til z (gmlz, isoz) for å få med høydekoordinat på ruteforslagenes geometri. Du må kontakte vegvesenet (ruteplan snabelA vegvesen.no) for å få opprettet brukernavn og passord for tjenesten.URL til tjenesten: https://www.vegvesen.no/ws/no/vegvesen/ruteplan/routingservice_v2_0/routingservice/ Merk at skråstreken (slash) \"/\" bak routingservice/ alltid må være med, for eksempel routingservice_v2_0/routingservice/?stops\u003d... Dokumentasjon: https://labs.vegdata.no/ruteplandoc/Vi har laget en enkel webklient for tjenesten som test/demo, med åpen kildekode.For nyheter, driftsmeldinger og tips om data fra Statens vegvesen, følg oss på twitter.com/VegvesenData."
  },
  "descriptionFormatted": {
