  },
  "description": {
    "nb": "Iht. opplæringsloven er elevens nærskole den skolen med kortest gå-avstand. For å antyde hvor disse skolegrensene går er det utarbeidet VEILEDENDE kart.Opplæringsloven gir samtidig kommunene mulighet til å vedta faste grenser mellom enkeltskoler. IForskrift om skoletilhørighet, Stavanger kommune er slike FASTE grenser innført mellom følgende skoler: Barneskoler: • Auglend skole og Tjensvoll skole • Kvernevik skole og Sunde skole • Byfjord skole, Tasta skole og Teinå skole • Hundvåg skole og Skeie skole • Eiganes skole og Lassa skole (fom. 2017) • Gausel skole og Godeset skole (fom. 2017) Ungdomsskoler: • Revheim skole og Smiodden skole • Tastarustå skole og Tastaveden skole • Austbø skole og Lunde skole"
  },
