  "title": {
    "nb": "Skoleruter for barne- og ungdomsskolene i Stavanger kommune"
  },
  "description": {
    "nb": "Inneholder skolerutene for alle barne- og ungdomsskoler i Stavanger. Skolene er oppført alfabetisk. Datasettet har en linje per skole per dag. Det består av 6 kolonner. Kolonnene «dato» og «skole» er selvforklarende. Kolonnen «elevdag» innneholder «ja» dersom det er en vanlig skoledag, «nei» dersom det er en fridag. I kolonnen «kommentar» står det beskrevet grunn til fridag. Kolonnen «laererdag» er nesten lik «elevdag», men her står det «ja» for de dagene som er planleggingsdager. Kolonnen «sfodager» innholder «ja» når SFO er åpen, ellers «nei»"
  },
