  },
  "description": {
    "nb": "Dette grensesnittet vil utgå 15.11.2019 til fordel for et nytt og moderne grensesnitt som er bedre egnet for applikasjonsutvikling, se: https://data.norge.no/data/arbeids-og-velferdsetaten-nav/ledige-stillinger-publisert-av-navStillingssøket på nav.no inneholder en oversikt over aktive ledige stillinger.Det maskinlesbare XML-grensesnittet har de samme søkeparametere som stillingssøket. For å lage en API-forespørsel anbefalles det å først avgrense søket og deretter hente ut adressen til API\u0027et nederst på siden hvor det står RSS-versjon. DFor å isolere engelskspråklige annonser, brukes søkeordet \"English\" som konvensjon for å fange opp disse annonsene.XML-formatet er RSS versjon 2.0 med tagger for attributter som er definert av Google Merchant Center og Apache Wicket.For stillingsannonser er HTML kildeformatet, men har også en del ekstra felter for attributter i tråd med den utgåtte Google Name Space Stillingsdata meldes og registreres i NAV basert på https://lovdata.no/dokument/NL/lov/2004-12-10-76/KAPITTEL_3#%C2%A77. Ikke alle stillinger som blir meldt til NAV blir publisert på nav.no Det blir kan på sikt bli endringer i denne tjenesten som følge av pågående videreutvikling av tjenester rettet mot arbeidsmarkedet samt implementering av infrastruktur/applikasjonsgrensesnitt for åpne data i NAV. Nytt applikasjonsgrensesnitt blir lansert første halvår 2019 og det gamle RSS-grensesnittet med widget vil bli avviklet."
  },
