  "title": {
    "nb": "Jordsmonn - Vannlagringsevne"
  },
  "description": {
    "nb": "Kartlag i datasettet Jordsmonn som viser den mengde plantetilgjengelig vann (målt i mm vannsøyle) som kan lagres i jorda ned til 60 cm dybde. Arealfigurer etter jordtype. Rundt halvparten av Norges fulldyrka og overflatedyrka jord er jordsmonnskartlagt, med hovedvekt på Sør-Østlandet, Trøndelag og Jæren. På enkelte steder er også også innmarksbeite kartlagt. Kartlaget er fremstilt i målestokk 1:5000 og er tilpasset bruk i målestokker fra 1:5000 til 1:20 000. Egenskap som skal brukes til å fremstille kartlaget heter VANNLAGRING."
  },
