  "title": {
    "nb": "Jordsmonn - Teksturgrupper i plogsjikt"
  },
  "description": {
    "nb": "Kartlag i datasettet Jordsmonn som viser den dominerende teksturgruppen i plogsjiktet. \nTeksturen er et uttrykk for kornstørrelsesfordelingen i jorda, og bedømmes i felt. Kartlaget inneholder ikke data dersom det er gjennomført forenklet kartlegging. Arealfigurer etter jordtype. Rundt halvparten av Norges fulldyrka og overflatedyrka jord er jordsmonnskartlagt, med hovedvekt på Sør-Østlandet, Trøndelag og Jæren. På enkelte steder er også også innmarksbeite kartlagt. Kartlaget er fremstilt i målestokk 1:5000 og er tilpasset bruk i målestokker fra 1:5000 til 1:20 000. Egenskap som skal brukes til å fremstille kartlaget heter TEKSTUR. Geografisk objekt er jordtype."
  },
