  "title": {
    "nb": "Arter av nasjonal forvaltningsinteresse"
  },
  "description": {
    "nb": "Datasettet viser kartlagte forekomster av arter som Miljødirektoratet anser for å ha nasjonal forvaltningsinteresse. Artene er valgt ut etter spesifikke kvalitetskrav (funksjon til art og geografisk presisjon på data) og åtte utvalgskriterier og vises under tre forskjellige forvaltningsnivåer. Datasettet inneholder både punkter og flater. Data i dette datasettet hentes fra Artsdatabankens tjeneste Artskart. Artskart henter og formidler data fra et stort antall databaser i ulike institusjoner, og innholdet i datasettet Arter av nasjonal forvaltningsinteresse utgjør en liten del av det totale volumet i Artskart."
