  "title": {
    "nb": "Vindressurser"
  },
  "description": {
    "nb": "På oppdrag fra NVE har Kjeller Vindteknikk gjennomført en landsomfattende kartlegging av vindressursene over fastlands-Norge og havområdene utenfor. Kartene har en horisontal oppløsning på 1x1 km og gir en beregnet årsmiddelvind i en høyde på henholdsvis 50, 80 og 120 meter over bakken. Kartene er tilgjengelig som nedlastbare PDF-filer.\n\nI tillegg til vindkart er det også utarbeidet kart over terrengkompleksitet og ising med samme oppløsning (1x1 km). Terrengkompleksitetskartet gir en indikasjon på hvor utsatt et område vil være for turbulente vindstrømmer. Turbulente vindstrømmer kan være en utfordring for vindkraftverk og vil normalt bidra til redusert kraftproduksjon og økt slitasje på turbinen. Ising på turbinblader kan i utsatte, spesielt høyereliggende, områder være et stort problem og bl.a. bidra til redusert turbinvirkningsgrad som får betydning for årsproduksjonen."
  },
  "descriptionFormatted": {
    "nb": "På oppdrag fra NVE har Kjeller Vindteknikk gjennomført en landsomfattende kartlegging av vindressursene over fastlands-Norge og havområdene utenfor. Kartene har en horisontal oppløsning på 1x1 km og gir en beregnet årsmiddelvind i en høyde på henholdsvis 50, 80 og 120 meter over bakken. Kartene er tilgjengelig som nedlastbare PDF-filer.\n\nI tillegg til vindkart er det også utarbeidet kart over terrengkompleksitet og ising med samme oppløsning (1x1 km). Terrengkompleksitetskartet gir en indikasjon på hvor utsatt et område vil være for turbulente vindstrømmer. Turbulente vindstrømmer kan være en utfordring for vindkraftverk og vil normalt bidra til redusert kraftproduksjon og økt slitasje på turbinen. Ising på turbinblader kan i utsatte, spesielt høyereliggende, områder være et stort problem og bl.a. bidra til redusert turbinvirkningsgrad som får betydning for årsproduksjonen."
