  "title": {
    "nb": "Digitale ortofoto"
  },
  "description": {
    "nb": "Ortofoto er flybilder med geometriske egenskaper som kart. Har de samme geometriske egenskaper som et kart og kan knyttes til et referansesystem. Ortofoto er inndelt i ulike ortofotostandarder egnet til forskjellige formål - ortofoto 10, 20 og 50. Ortofoto er inndelt i ulike ortofotostandarder egnet til\nforskjellige formål. Ortofoto 10: Dekker normalt byområder og utbyggingsområder der det er behov for god stedfestingsnøyaktighet og høy oppløsning. Bakkeoppløsningen er 4-15 cm. Ortofoto 20: Dekker områder som i hovedsak består av tett- og spredt bebyggelse og jordbruksområder.\nBakkeoppløsning er vanligvis 20 cm. Ortofoto 50: Omløpsfotografering som skal dekke hele\nlandet. Bakkeoppløsning på disse er enten 50, 40 eller 25 cm. Fra 2012 gjelder bakkeoppløsning 25 cm for ortofoto fra omløpsfotografering."
  },
  "descriptionFormatted": {
    "nb": "Ortofoto er flybilder med geometriske egenskaper som kart. Har de samme geometriske egenskaper som et kart og kan knyttes til et referansesystem. Ortofoto er inndelt i ulike ortofotostandarder egnet til forskjellige formål - ortofoto 10, 20 og 50. Ortofoto er inndelt i ulike ortofotostandarder egnet til\nforskjellige formål. Ortofoto 10: Dekker normalt byområder og utbyggingsområder der det er behov for god stedfestingsnøyaktighet og høy oppløsning. Bakkeoppløsningen er 4-15 cm. Ortofoto 20: Dekker områder som i hovedsak består av tett- og spredt bebyggelse og jordbruksområder.\nBakkeoppløsning er vanligvis 20 cm. Ortofoto 50: Omløpsfotografering som skal dekke hele\nlandet. Bakkeoppløsning på disse er enten 50, 40 eller 25 cm. Fra 2012 gjelder bakkeoppløsning 25 cm for ortofoto fra omløpsfotografering."
