  },
  "description": {
    "nb": "Kommunvise kartlag i datasettet Vegetasjon som viser vegetasjonsdekket delt inn i 3 beiteklassar for storfe. Grunnlaget for inndeling er innhaldet av beiteplanter i vegetasjonstypane og hovedtrekk i storfe sine beitevanar. Kartlaget er tilpasset bruk i målestokker fra 1:2000 til 1:50 000. Dekning varierer - rundt 20 000 km2 er kartlagt. Egenskap som skal brukes til å fremstille kartlaget heter STORFE_BESKRI. Areal i kvadratmeter er oppført i egenskap AREA_C."
  },
