  "title": {
    "nb": "Naturtyper - utvalgte"
  },
  "description": {
    "nb": "Datasettet viser registrerte forekomster av utvalgte naturtyper som som ble vedtatt av Kongen i Statsråd 13.05.2011 etter naturmangfold-lovens § 52. De utvalgte naturtypene omfatter: Slåttemark, Slåttemyr, Kalksjøer, Kalk-lindeskog, Hule eiker. Forskriften gjelder ikke innenfor verneområder. Forskriften for utvalgte naturtyper gjelder uavhengig av om forekomsten er registrert i Naturbase eller ikke, forutsatt at den fyller kravene i forskriften. Fylkesmannen vil etter beste evne informere grunneiere og andre tiltakshavere om forekomster av utvalgte naturtyper, og vil kunne bistå dersom det er usikkerhet om hvorvidt en registrert forekomst av en utvalgt naturtype er reell eller ikke."
  },
  "descriptionFormatted": {
    "nb": "Datasettet viser registrerte forekomster av utvalgte naturtyper som som ble vedtatt av Kongen i Statsråd 13.05.2011 etter naturmangfold-lovens § 52. De utvalgte naturtypene omfatter: Slåttemark, Slåttemyr, Kalksjøer, Kalk-lindeskog, Hule eiker. Forskriften gjelder ikke innenfor verneområder. Forskriften for utvalgte naturtyper gjelder uavhengig av om forekomsten er registrert i Naturbase eller ikke, forutsatt at den fyller kravene i forskriften. Fylkesmannen vil etter beste evne informere grunneiere og andre tiltakshavere om forekomster av utvalgte naturtyper, og vil kunne bistå dersom det er usikkerhet om hvorvidt en registrert forekomst av en utvalgt naturtype er reell eller ikke."
