  "title": {
    "nb": "Jord- og flomskred aktsomhetsområder"
  },
  "description": {
    "nb": "Aktsomhetsområder for jord- og flomskred viser potensielle utløpsområder for alle typer løsmasseskred bortsett fra kvikkleireskred og store flomskred i slake elveløp.\nVed bruk av datasettet til analyseformål bør som hovedregel hele utløpsområdet vurderes. Utløpsområdet dekker alle areal hvor skredet fortsatt inneholder en viss andel fast materiale som kan avsettes. Dersom vanninnholdet i skredet er veldig høyt, kan selve vanninnholdet av skredet i visse tilfeller flyte enda lenger.\nAktsomhetskartet kan være nyttige i samband med overvåkning og beredskap i spesielt utsatte områder\nder mer detaljerte kart ikke finnes."
  },
