  "title": {
    "nb": "Reindrift - Årstidsbeite - Høstvinterbeite"
  },
  "description": {
    "nb": "Den sesongmessige arealbruken er delt inn i fem årstider, som igjen er delt inn i to kategorier etter funksjon og beiteintensitet. Høstvinterbeite er områder som reinen bruker på høstvinteren. Høstvinterbeitene er igjen delt i to kategorier: Høstvinterbeite 1 - Intensivt brukte områder, som ofte pakkes til med snø og blir utilgjengelige for reinen utover vinteren. Høstvinterbeite 2 - Spredt brukte områder for samme periode som høstvinterbeite. Beitebruken vil variere fra år til år innen samme område. Inndelingssystemet gjelder reindrifta i hele landet. De årlige variasjonene i bl.a. vær og beiteforhold gjør at årstidsavgrensningene må bli noe vide og omtrentlige."
  },
